import React from 'react'

export const Contact = () => {
  //const Student = "http://dummy.restapiexample.com/api/v1/employees";  
  const Student = getJSON('http://dummy.restapiexample.com/api/v1/employees')
      .then(({ results }) => this.setState({ person: results }));  

  return (
    <>  
    <div className="container">
        <div className='mt-3 mb-5'>
            <h3 className='text-center'>Contact Us</h3> <hr />
            <p>Given the code below, we use the map() function to take an array of numbers and double their values. We assign the new array returned by map() to the variable doubled and log it:</p>  
            <div>{Student}</div>
        </div>
    </div>
    </>
  )
}
